  public void selectionSort(Float[] array) {
    Float temp;
    for (int i = 0; i < array.length - 1; i++) {
      for (int j = i + 1; j <= array.length - 1; j++) {
        if (array[i] > array[j]) {
          temp = array[i];
          array[i] = array[j];
          array[j] = temp;
        }
      }
    }
  }

